import React, { Component } from "react";

import "./Node.css";

export default class Node extends Component {
  constructor(props) {
    super(props);
    this.state = {
      col: Number,
      row: Number,
      g: Number,
      h: Number,
      isStartNode: Boolean,
      isEndNode: Boolean,
      isVisited: Boolean,
      isObstacle: Boolean,
      neighbors: Array,
      parentNode: Object,
    };
  }

  // Euclidean hueristic function
  getEuclideanDistanceToNode(otherNode) {
    return (
      (this.col - otherNode.col) * (this.col - otherNode.col) +
      (this.row - otherNode.row) * (this.row - otherNode.row)
    );
  }

  render() {
    const { isStartNode, isEndNode, isVisited } = this.props;
    const getNodeClass = isStartNode
      ? "node-start"
      : isEndNode
      ? "node-end"
      : isVisited
      ? "node-visited"
      : "";

    return <div className={`node ${getNodeClass}`}></div>;
  }
}
